        return False
    count_X = board.count('X')
    count_O = board.count('O')
    if not (count_X == count_O or count_X == count_O + 1):
        return False
    winning_combinations = [(0, 1, 2), (3, 4, 5), (6, 7, 8), (0, 3, 0), (1, 4, 7), (2, 5, 8), (0, 4, 8), (2, 4, 6)]
    x_wins = False
    o_wins = False
    for (a, b, c) in winning_combinations:
        if board[a] == board[b] == board[c]:
            if board[a] == 'X':
                x_wins = True
            elif board[a] == 'O':
                o_wins = True
    if x_wins and o_wins:
        return False
    if o_wins and count_X != count_O:
        return False
    if x_wins and count_X != count_O + 1:
        return False
    return True

